import {SearchPageWrapper} from '../atoms'
import React, {useCallback, useState} from 'react'
import {FixedHeader} from '../../../../Components/FixedHeader'
import {AllSearchList, OfferingsList, OrganizationList, SearchFixedHeader} from '../organisms'

export const SearchPage = ({setOpenSearch}) => {
    const [active, setActive] = useState('all')
    const [searchText, setSearchText] = useState('')

    const generateData = useCallback((item) => {
        switch (item) {
            case 'organization': {
                return <OrganizationList searchText={searchText}/>
            }
            case 'offerings': {
                return <OfferingsList searchText={searchText}/>
            }
            default: {
                return <AllSearchList searchText={searchText}/>
            }
        }
    }, [searchText])

    return (
        <SearchPageWrapper>
            <FixedHeader
                component={<SearchFixedHeader
                    active={active}
                    setActive={setActive}
                    searchText={searchText}
                    setOpenSearch={setOpenSearch}
                    setSearchText={setSearchText}
                />}
            />
            {generateData(active)}
        </SearchPageWrapper>
    )
}
